description:
Продается владельцем. Ввезена из Германии в июне 2013 и с августа 2013 у меня.
Отличное состояние по двигателю, коробке, подвеске. Есть мелкие косяки по кузову, уступлю в цене по договоренности. Продается как есть, без предпродажной подготовки.
В год проезжал 7-10 тыс. км. От дома до офиса 4 км ( Сокол-Динамо). В объявлении честный пробег, на спидометре меньше, так было при покупке. 
Два комплекта резины на дисках: Летний комплект на 18" дисках. Зимний на 16". Резина 2 сезона в эксплуатации.
Богатая комплектация:
Панорамный люк;
Парктроник;
M-руль;
Кожаный салон, электрорегулировка передних сидений с памятью;
Круиз контроль;
2-х зонный климат контроль;
Жёсткий диск для музыки;
Заводской Webasto;
Дверь багажника на электроприводе.

Богатая комплектация:
Комфортный доступ;
Спортивные передние сиденья с регулировками бокового и поясничного подпора, подколенных подушек;
Панорамный люк;
Парктроник;
M-руль;
Кожаный салон, электрорегулировка передних сидений с памятью;
Электр. Регулировка руля;
Круиз контроль;
Hands free;
2-х зонный климат контроль;
Жёсткий диск для музыки;
Заводской Webasto на пульте;
Дверь багажника на электроприводе.
И т. д.

Все автомобили, представленные в продаже, проходят диагностику по более 48 параметрам, с результатами диагностики Вы можете ознакомиться при осмотре автомобиля.

Предоставляем гарантию юридической чистоты, а так же год технической гарантии на двигатель и КПП в письменной форме.

Дополнительная скидка до 50 000 рублей при покупке а/м по программе Trade-In (обмен на ваш автомобиль) и до 100 000 рублей при покупке а/м в кредит!

Цена действительна при соблюдении ряда условий.



Преимущества автокредитования:
— Ставка по кредиту от 4.9% годовых;
— Первоначальный взнос от 0%;
— Более 23 кредитных программ;
— Минимальный пакет документов – паспорт и вод. удостоверение;
— Срок кредита от 6 месяцев до 7 лет;
— Сумма кредита от 60 000 руб. до 3 000 000 рублей;
— Досрочное погашение без штрафов и комиссий;
— КАСКО – необязательно.

Комплект зимней резины в подарок!

Приглашаем на бесплатный тест-драйв! Более подробную информацию можно получить по указанному номеру телефона.

Автомобиль в отличном состоянии, ухоженный салон, своевременное обслуживание. Комплектация: 4-х зонный климат-контроль, проекция на лобовое стекло, доводчики дверей, отделка приборной панели кожей, обогрев, вентиляция и память передних кресел, люк, камеры и парктроники сзади и спереди, система старт/стоп. Для более подробной информации, пожалуйста, свяжитесь с нашими менеджерами.

Наши преимущества:
- Гарантия юридической чистоты;
- Скидка при обмене на Ваш автомобиль по системе (trade-in);
- Гибкая кредитная программа, которая предусматривает более тридцати банков страны, что позволяет выбрать и сформировать наиболее оптимальные условия для автокредитования;
- Удобное расположение: мы находимся в минуте от станции метро Площадь Ильича/Римская;
- Возможность проведения диагностики в сервисе;
- Профессиональная предпродажная подготовка.

Вашему вниманию представляем автомобиль с пробегом BMW X5

Автомобиль в хорошем состоянии. ПТС оригинал. Аккуратная эксплуатация.
Мультимедиа: AUX, Bluetooth
Салон: кожа, 5 мест, подогрев сидений, электропривод, водительское с памятью положения, Передний центральный подлокотник, Третий задний подголовник, Тонированные стекла
Комфорт: электростеклоподъемники, климат-контроль, круиз-контроль, парктроник, 
Электропривод зеркал, мультируль, Люк, Панорамная крыша
Автомобиль прошел предпродажную подготовку. Готов к эксплуатации.

Автосалон "PROFFIT" гарантирует:

— 100 % юридическую чистоту автомобиля в письменном виде;
— У нас нет скрытых доплат, платежей и комиссий;
— Автомобили прошли комплексную предпродажную подготовку;
— При обмене на Ваш автомобиль действуют скидка до 30 000 руб.;
— Есть возможность провести тест-драйв;
— Выкуп Вашего автомобиля по выгодной цене.

АВТОКРЕДИТОВАНИЕ:

— Первоначальный взнос от 0%;
— Минимальный пакет документов – паспорт и вод. удостоверение;
— Досрочное погашение без штрафов и комиссий;
— КАСКО – необязательно.
Сотрудничаем с 15 аккредитованными и сертифицированными банками РФ, среднее время ожидания решения банка 30–50 минут.

АВТОМОБИЛЬ ДОСТУПЕН К ПРОСМОТРУ В КРЫТОМ И ОСВЕЩЕННОМ ПОМЕЩЕНИИ. Ждем Вас с 9:00 до 21:00, каждый день без перерыва и выходных. Пешая доступность от метро Беломорская (300 метров).

Для покупателей с региона автосалон "PROFFIT" дарит бонусы:

— ПРИ ПОКУПКЕ ЭТОГО АВТОМОБИЛЯ В КРЕДИТ - Оплата проезда (только по билетам) для покупателей с региона;
— Помощь в постановке на учет в ГИБДД;
— Страховка и Диагностическая карта по вашему коэффициенту.

В нашем автосалоне "PROFFIT" большой выбор автомобилей разных классов – от бюджетных семейных автомобилей до внедорожников. Индивидуальный подход к каждому покупателю и гарантированные подарки, бонусы и скидки! Мы позаботимся сделать Вашу покупку более приятной и выгодной!

Реальному покупателю - реальный торг и НЕРЕАЛЬНЫЙ подарок от которого будите в восторге не меньше чем от покупке! Звоните!

Продается спортивный автомобиль, построенный для участия в соревнованиях по дрифту.

— двигатель GM LSA 750+ л.с. , МКПП;

— каркас безопасности Энергия, доработан до тех. требований Регламента Российской Дрифт Серии (RDS – Russian Drift Series);

— подрамник и рычаги от BMW М3 и Wisefab окрашены в серебряный и золотистый цвета;

—  подвеска Wisefab на ШС ;

— приобретен и устанавливается новый редуктор с дисковой блокировкй от М5 Е60;

— тормозная система от М-версии. Суппорта окрашены в золото;

— изготовлены легкие втулки в задний подрамник;

— кузов машины максимально облегчили путем отрезания всего лишнего;

— опоры двигателя от HGK Racing;

— плита крепления редуктора к подрамнику, изготовленная на заказ на авиационном заводе;

— изготовлена кастом выхлопная система, сварены два равнодлинных коллектора из нержавеющей стали (изготовил Алексей chsproducts). Коллектора покрыты керамическим напылением;

— бензобак, изготовленный с соблюдением всех стандартов безопасности. 7 противоотливных пластин призваны исключить топливное голодание даже в самых скоростных поворотах;

— напольный педальный узел из кованного алюминия Tilton Series 600;

— армированные тормозные шланги Goodridge и компоненты тормозной системы Tilton;

— огне- и жаростойкие чехлы на свечные высоковольтные провода. Необходимы для сохранения проводов от экстремальных тепловых нагрузок, т.к. находятся в непосредственной близости от коллекторов;

— гоночный легкий и малогабаритный аккумулятор Aliant;

— стаканы усилены, к лонжеронам приварены дугообразные трубы;

— приобретен шведский масляный радиатор;

— воздушный фильтр пониженного сопротивления AEM (США);

— изготовлен и установлен кастом рулевой вал;

— омолгированные до 2021 г. ковши SPARCO EVO, руль OMP c быстросъемным устройством;

— несколько вариантов ручки КПП;

— мощный топливный насос Bosch;

— заводской кузов родстера доработан путем установки расширения +5 см с каждой стороны в стиле Rocket Bunny, переднего бампера BMW M1 Style и спойлера-дактейла, весь кузов выполнен из стеклопластика;

— карбоновые дверные карты;

— буксировочные петли Sparco;

— два варианта съемной жесткой крыши — из сухого карбона и из стеклопластика. 


Автомобиль на номерах. Помощь в оформлении. Имеется спортивный паспорт. На все вопросы отвечу по телефону. 

